import React from "react";
import Typography from '@mui/material/Typography';

const ShifterText = (props) => {
    return (
        <div>
          <Typography variant="body1" gutterBottom>
            {props.time} <span>-</span>{props.employee}
          </Typography>
        </div>
      );

}

export default ShifterText;
